import './style.css';
import "./Profile.css";

export default function Header({type, title, desc}) {

    return (
          
    <div class = "header-box">
    <div class = "header">

      <img class = "header-image" src = "Images-Profile/profile.png"/>

      <div class = "header-info">
          <div class = "header-type">{type}</div>
          <div class = "header-title">{title}</div>
          <div class = "header-desc">{desc}</div>
      </div>

    </div>

  </div>
    );
}
